SET SEARCH_PATH TO public;

--страницы
CREATE TABLE IF NOT EXISTS pages
( nzp_page  serial NOT NULL,
  up_kod    integer,
  group_id  integer,
  page_url  char(200),
  page_menu char(200),
  page_name char(200),
  hlp       char(200),CONSTRAINT pk_pages PRIMARY KEY (nzp_page))
WITHOUT OIDS;
DROP INDEX IF EXISTS ix_pages_1;
CREATE UNIQUE INDEX ix_pages_1 on pages(nzp_page);

--связи между страницами
CREATE TABLE IF NOT EXISTS page_links (
	page_from integer,
	group_from integer,
	page_to integer,
	group_to integer,
	sign char(120))
WITHOUT OIDS;

--роли
CREATE TABLE IF NOT EXISTS s_roles(
nzp_role serial NOT NULL,
role character(120),
page_url integer DEFAULT 0,
sort integer DEFAULT 0)
WITHOUT OIDS;
DROP INDEX if exists ix_srls_1;
CREATE UNIQUE INDEX ix_srls_1 ON s_roles USING btree (nzp_role);
DROP INDEX IF EXISTS ix_srlc_2;
CREATE INDEX ix_srlc_2 ON s_roles USING btree  (nzp_role, page_url);

--связь действий
CREATE TABLE IF NOT EXISTS actions_lnk(
nzp_al serial NOT NULL,
cur_page integer NOT NULL,
nzp_act integer NOT NULL DEFAULT 0,
page_url integer NOT NULL DEFAULT 0)
WITHOUT OIDS;
DROP INDEX IF EXISTS ix_actl_1;
CREATE UNIQUE INDEX ix_actl_1 on actions_lnk(nzp_al);
DROP INDEX IF EXISTS ix_actl_2;
CREATE INDEX ix_actl_2 on actions_lnk USING btree (cur_page, nzp_act);

--действия со страницами
CREATE TABLE IF NOT EXISTS actions_show(
nzp_ash serial NOT NULL,
cur_page integer NOT NULL,
nzp_act integer NOT NULL DEFAULT 0,
act_tip integer NOT NULL DEFAULT 0,
act_dd integer NOT NULL DEFAULT 0,
sort_kod integer NOT NULL DEFAULT 0,
sign char(120),
CONSTRAINT fk_actl_01 FOREIGN KEY (nzp_act)
REFERENCES s_actions (nzp_act) MATCH SIMPLE
ON UPDATE NO ACTION ON DELETE NO ACTION)
WITHOUT OIDS;
DROP INDEX IF EXISTS ix_actsh_1;
CREATE UNIQUE INDEX ix_actsh_1 on actions_show(nzp_ash);
DROP INDEX IF EXISTS ix_actsh_2;
CREATE UNIQUE INDEX ix_actsh_2 ON actions_show USING btree (cur_page, nzp_act, act_tip, act_dd);

--изображения
CREATE TABLE IF NOT EXISTS img_lnk(
nzp_img serial NOT NULL,
cur_page integer NOT NULL,
tip integer NOT NULL,
kod integer NOT NULL,img_url char(255))
WITHOUT OIDS;
DROP INDEX IF EXISTS ix_img_lnk_1;
CREATE UNIQUE INDEX ix_img_lnk_1 on img_lnk(nzp_img);
DROP INDEX IF EXISTS ix_img_lnk_2;
CREATE UNIQUE INDEX ix_img_lnk_2 ON img_lnk USING btree (cur_page, tip, kod);

--pages_show
CREATE TABLE IF NOT EXISTS pages_show(
nzp_psh serial NOT NULL,
cur_page integer NOT NULL,
page_url integer NOT NULL DEFAULT 0,
up_kod integer NOT NULL DEFAULT 0,
sort_kod integer NOT NULL DEFAULT 0,
sign char(255))
WITHOUT OIDS;
DROP INDEX IF EXISTS ix_pagesh_1;
CREATE UNIQUE INDEX ix_pagesh_1 on pages_show(nzp_psh);
DROP INDEX IF EXISTS ix_pagesh_2;
CREATE UNIQUE INDEX ix_pagesh_2 ON pages_show USING btree (cur_page, page_url, up_kod);

--ключи ролей
CREATE TABLE IF NOT EXISTS roleskey(
nzp_rlsv serial NOT NULL,
nzp_role integer NOT NULL,
tip integer NOT NULL,
kod integer NOT NULL,
sign char(90))
WITHOUT OIDS;
DROP INDEX IF EXISTS ix_rlsk_1;
CREATE UNIQUE INDEX ix_rlsk_1 on roleskey(nzp_rlsv);
DROP INDEX IF EXISTS ix_rlsk_2;
CREATE UNIQUE INDEX ix_rlsk_2 on roleskey USING btree(nzp_role, tip, kod);

--s_actions
CREATE TABLE IF NOT EXISTS s_actions(
nzp_act serial NOT NULL,
act_name char(200) NOT NULL,
hlp char (255),CONSTRAINT pk_actions PRIMARY KEY (nzp_act))
WITHOUT OIDS;
DROP INDEX IF EXISTS ix_sact_1;
CREATE UNIQUE INDEX ix_sact_1 on s_actions(nzp_act);

--страницы роли
CREATE TABLE IF NOT EXISTS role_pages (
	id serial NOT NULL,
	nzp_role integer NOT NULL,
	nzp_page integer NOT NULL,
	sign char(120))
WITHOUT OIDS;
DROP INDEX IF EXISTS ix_role_pages_1;
CREATE UNIQUE INDEX ix_role_pages_1 on role_pages(id);
DROP INDEX IF EXISTS ix_role_pages_2;
CREATE UNIQUE INDEX ix_role_pages_2 on role_pages(nzp_role, nzp_page);

--действия роли
create table if not exists role_actions (
	id serial NOT NULL,
	nzp_role integer NOT NULL,
	nzp_page integer NOT NULL,
	nzp_act integer NOT NULL,
	mod_act integer,
	sign char(120))
WITHOUT OIDS;
drop index if exists ix_role_actions_1;
create unique index ix_role_actions_1 on role_actions(id);
drop index if exists ix_role_actions_2;
create unique index ix_role_actions_2 on role_actions(nzp_role, nzp_page, nzp_act);

--Создание табл. Report (отчеты)
CREATE TABLE IF NOT EXISTS report (
	nzp_rep serial NOT NULL,
	nzp_act int,
	name varchar(255),
	file_name varchar(255))
WITHOUT OIDS;
DROP INDEX IF EXISTS ix_report_1;
CREATE UNIQUE INDEX ix_report_1 on report(nzp_rep);

